import './App.css';
import './litegride.css';
import React, { useState } from 'react';
import { Chart } from "react-google-charts";
import 'gridstack/dist/gridstack.min.css';
import { GridStack } from 'gridstack';

function App() {
  const [options, setOptions] = useState({
    title: 'Gráfico de Pizza'
  });
  const [optionsBar, setOptionsBar] = useState({
    title: 'Gráfico de Barra'
  });
  const [data, setData] = useState([
    ['Linguagens', 'Quantidade'],
    ['React', 100],
    ['Angula', 80],
    ['Vue', 50],
  ]);
  const [dataBar, setDataBar] = useState([
    ['Cidades', '2010 População', '2000 População'],
    ['New York City, NY', 8175000, 8008000],
    ['Los Angeles, CA', 3792000, 3694000],
    ['Chicago, IL', 2695000, 2896000],
    ['Houston, TX', 2099000, 1953000],
    ['Philadelphia, PA', 1526000, 1517000],
  ]);
  GridStack.init();
  return (
    <div className="container">
      <div className="grid-stack">
        <div className="grid-stack-item">
          <div className="grid-stack-item-content"><div style={{ display: "flex" }}>
            <Chart
              width={'500px'}
              height={'300px'}
              chartType="PieChart"
              data={data}
              options={options}
            />
            <Chart
              width={'500px'}
              height={'300px'}
              chartType="BarChart"
              data={dataBar}
              options={optionsBar}
            />
          </div></div>
        </div>
        <div className="grid-stack-item" gs-w="2">
          <div className="grid-stack-item-content">Item 2 wider</div>
        </div>
        <div className="grid-stack-item" gs-w="2">
          <div className="grid-stack-item-content">Item 3 wider</div>
        </div>
        <div className="grid-stack-item" gs-w="2">
          <div className="grid-stack-item-content">Item 4 wider</div>
        </div>
        <div className="grid-stack-item" gs-w="2">
          <div className="grid-stack-item-content">Item 5 wider</div>
        </div>
        <div className="grid-stack-item" gs-w="2">
          <div className="grid-stack-item-content">Item 6 wider</div>
        </div>
        <div className="grid-stack-item" gs-w="2">
          <div className="grid-stack-item-content">Item 7 wider</div>
        </div>
      </div>
    </div>
  );
}

export default App;
